import React from "react";

const Header = () => {
  return (
    <header>
      <div>
        <h1 className="logoTxt">
          <span className="logo1">Makaan</span>
          <span className="logo2">Estate</span>
        </h1>
      </div>
    </header>
  );
};

export default Header;
